  return (
    <>
      <div>
        {dummy.isLogin &&
          <Form encType="multipart/form-data">
            <Input.TextArea maxLength={140}>

            </Input.TextArea>
          </Form>
        }
      </div>
    </>
  )
}

export default Home;
